import React, { useEffect } from 'react'
import axios from 'axios'

export default function App() {
  useEffect(() => {
    const res = axios
      .get(
        'https://www.flipkart.com/redmi-note-4-black-64-gb/p/itmeqe48766xqzb7?pid=MOBEQ98TABTWXGTD',
        {
          headers: {
            'Content-Type': 'application/json',
            'Access-Control-Allow-Origin': '*',
          },
        },
      )
      .then((res) => {
        console.log(res)
      })
      .catch((err) => {
        console.log(err)
      })
  }, [])

  const calldata = async () => {
    try {
      const res = await fetch(
        'https://www.flipkart.com/redmi-note-4-black-64-gb/p/itmeqe48766xqzb7?pid=MOBEQ98TABTWXGTD',
        {
          method: 'GET',
          headers: {
            Accept: 'appllication/json',
            'Content-Type': 'application/json',
          },
          credentials: 'include',
        },
      )

      const data = await res.json()
      console.log(data)
      if (!data.status === 200) {
        const err = new Error(data.error)
        throw err
      }
    } catch (err) {
      console.log(err)
      navigate('/login', { replace: true })
    }
  }

  return <div></div>
}
